import './itemcard.css';

const item = (param) => {
    return(
        <>
            <div id="card {param.flip}">
                <img src = ".\images\machine-learning.jpg" id="profile photo"></img>
                <h1 id="title">{param.title}</h1>
                <span id="desc">{param.desc}</span>
            </div>
        </>
    )
};

export default item
